import React from "react";
import '../ProjectSection.css';

import img2 from '../project-media/Bit Logo/building-mockup.png'
import img3 from '../project-media/Bit Logo/stationary-mockup.png'


function BitLogo() {
    return(
        <>
            <div className="project-media-container">
                <img src={img2} className="project-media"></img>
            </div>
            <div className="project-media-container">
                <img src={img3} className="project-media"></img>
            </div>
        </>
    )
}

export default BitLogo;
